import React from 'react';
import './style.css';
import logo from './images/logo4.svg';
import icon1 from './images/icon1a.svg';
import icon2 from './images/icon2p.svg';
import icon3 from './images/icon3p.svg';

const Navbar1 = () => {

  return (
    <div>
      <div className="Nav1">
        <img src={logo} />
      </div>
      <div className="menu">
          <div className="iconslist">
            <div className="icons">
              <img src={icon1} />
              <a className="iconlabel">Home</a>
            </div>
            <div className="icons">
              <img src={icon2}/>
              <a className="iconlabel">Devices</a>
            </div><div className="icons">
              <img src={icon3}/>
              <a className="iconlabel">Report</a>
            </div>
          </div>
        </div>
    </div>
  );
};

export default Navbar1;
